import Timer from './Timer';
import styled from 'styled-components';

const Container = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 100vh;
`;

const Title = styled.p`
    font-size: 20px;
    font-family: calibri;
    color: black;
    margin-bottom: 30px;
    font-weight: bold;
    letter-spacing: 1px;
    text-transform: uppercase;
`;

const App = () => (
    <Container id="app">
        <Title>Timer 1.0</Title>
        <Timer></Timer>
    </Container>
);

export default App;
